// +build example jsgo

package main

import (
	"bytes"
	"fmt"
	"image"
	"log"
	"math"
	"math/rand"
	"time"

	"github.com/hajimehoshi/ebiten/inpututil"

	"github.com/hajimehoshi/ebiten/ebitenutil"

	"github.com/hajimehoshi/ebiten"
)

var gameImage *ebiten.Image
var currentSprite *ebiten.Image
var spriteX float64
var spriteY float64
var spriteCount int
var score int
var clickCount int
var lastClick time.Time
var wasClicked bool

func init() {
	img, _, err := image.Decode(bytes.NewReader(spriteBytecode))
	if err != nil {
		fmt.Println(err)
	}
	gameImage, _ = ebiten.NewImageFromImage(img, ebiten.FilterDefault)
	spriteX = float64(rand.Intn(1280 - 96))
	spriteY = float64(rand.Intn(720 - 96))

	rand.Seed(time.Now().Unix())
}

// Game only implements sprites
type Game struct {
	Sprites []*ebiten.Image
}

func (g *Game) Draw(screen *ebiten.Image) {
	if currentSprite == nil {
		currentSprite = g.Sprites[rand.Intn(len(g.Sprites))]
	}
	ebitenutil.DebugPrint(screen, fmt.Sprintf("Score: %v\nMisclicks: %v", score, clickCount-score))

	op := &ebiten.DrawImageOptions{}
	op.GeoM.Translate(spriteX, spriteY)
	screen.DrawImage(currentSprite, op)

}
func (g *Game) Update(screen *ebiten.Image) error {
	dt := time.Since(lastClick).Seconds()

	wasClicked = inpututil.IsMouseButtonJustPressed(ebiten.MouseButtonLeft)
	if wasClicked || dt > (3/math.Log(float64(score+1))) {
		clickCount++
		if wasClicked {
			cx, cy := ebiten.CursorPosition()
			if contains(cx, cy, int(spriteX), int(spriteY)) {
				score++
			}
		}
		spriteX = float64(rand.Intn(1280 - 96))
		spriteY = float64(rand.Intn(720 - 96))
		currentSprite = g.Sprites[rand.Intn(len(g.Sprites))]
		lastClick = time.Now()
		wasClicked = false
	}

	return nil
}

func contains(cx, cy, ix, iy int) bool {
	return (cx >= ix && cx <= ix+96) && (cy >= iy && cy <= cy+96)
}

func (g *Game) Layout(outsideWidth, outsideHeight int) (int, int) {
	return 1280, 720
}

//NewGame returns game object
func NewGame() *Game {
	var sprites []*ebiten.Image
	for i := 0; i < 7; i++ {
		for x := 0; x < 5; x++ {
			sprites = append(sprites, gameImage.SubImage(image.Rect(i*96, x*96, i*96+96, x*96+96)).(*ebiten.Image))
		}
	}
	return &Game{Sprites: sprites}
}
func main() {
	ebiten.SetWindowSize(1280, 720)
	ebiten.SetWindowTitle("Gopher Smasher")
	if err := ebiten.RunGame(NewGame()); err != nil {
		log.Fatal(err)
	}
}

